import { Outlet, Link } from "react-router-dom";
import './Layout.css';
const Layout = () => {
  return (
    <>
      <nav>
        <table>
          <tbody>
            <tr>
                <td width={75} text-align="centre"><Link to="/">Home</Link></td>
                <td width={75} text-align="centre"><Link to="/artistList">Artist</Link></td>
                <td width={75} text-align="centre"><Link to="/add">Add artist</Link></td>
            </tr>
          </tbody>
        </table>
      </nav>

      <Outlet />
    </>
  )
};

export default Layout;
